import './CBased.css';
import React, {Component} from "react";
import {h} from "./../Home/Home";

let songName = h.getSongName();

class CBased extends Component{

	render() {
	 let songs = this.props.songName;
	 console.log(songs + "lalalalalla");
     return(
      <div className="CF">
      	<h1>Content Based Reccommendation!</h1>
      	<h1 style={{'fontSize': '15px','marginTop': '5px' }}>User top songs: {songs} </h1>
      </div>
     );
    }
}

export default CBased;
